import logo from '../../images/logo2.png';
import UsersRemotePanel from '../UsersRemotePanel/UsersRemotePanel';


export default function Header() {
  return (
    <header className="header">
      <div className='header_block_1'></div>
      <div className='header_block_2'>
        <img className='logo_theme_light' src={logo}/>
        <UsersRemotePanel/>
      </div>
      <nav className='header_block_3'>
        <ul className='header__menu'>
          <li className='navlink_size_m'></li>
          <li className='navlink_size_m'></li>
          <li className='navlink_size_m'></li>
          <li className='navlink_size_m'></li>
          <li className='navlink_size_m'></li>
        </ul>
      </nav>
    </header>
  )
}

